import * as React from "react";
import "./Matching.css";

import Navbars from "../Navbar/navbarHome2.js";
import Drawer from "../Drawer/Drawer";
import {
  FaLanguage,
  FaFile,
  FaLongArrowAltLeft,
  FaLongArrowAltRight,
} from "react-icons/fa";
import { MdCameraAlt, MdArrowDropDown } from "react-icons/md";


import { Box, Autocomplete } from "@mui/material";
import { data } from "../Data/data";

const Matching = () => {
  const [value, setValue] = React.useState(new Date());
  const [value2, setValue2] = React.useState(new Date());

  return (
    <div className="App-body-Order">
      <header className="App-header">
        <Navbars />
      </header>

      <Box sx={{ display: "flex", width: "100% " }}>
        <Drawer />

        <div style={{ marginTop: 60, height: 100 }}>
          <h4
            style={{
              fontWeight: 500,
              fontSize: 36,
              color: " #333333",
              marginLeft: 20,
              position: "absolute",
              top: "13%",
            }}
          >
            Translate
          </h4>
        </div>

        <div className="bodyMatching">
          <div style={{ margin: 30 }}>
            <p
              style={{
                textAlign: "start",
                color: "#034D82",
                fontWeight: 600,
                fontSize: 24,
              }}
            >
              Article
            </p>
            <div style={{ textAlign: "start" }}>
              <button className="buttonMatching">
                <FaLanguage className="iconsMatching" />
                <p className="textMatching">Text</p>
              </button>
              <button className="buttonMatching">
                <FaFile className="iconsMatching" />
                <p className="textMatching">File</p>
              </button>
            </div>
            <p
              style={{
                textAlign: "start",
                color: "#353535",
                fontSize: 18,
              }}
            >
              language
            </p>
            <Autocomplete
              multiple
              id="country-select-demo"
              sx={{ width: "100%" }}
              options={data}
              autoHighlight
              getOptionLabel={(option) => option.label}
              onChange={(event, value) => setLanguages(value?.label)}
              popupIcon={
                <MdArrowDropDown
                  style={{ color: "#333333", width: 30, height: 33 }}
                />
              }
              renderOption={(props, option) => (
                <Box
                  component="li"
                  sx={{ "& > img": { mr: 2, flexShrink: 0 } }}
                  {...props}
                >
                  <img
                    loading="lazy"
                    width="20"
                    src={`https://flagcdn.com/w20/${option.code.toLowerCase()}.png`}
                    srcSet={`https://flagcdn.com/w40/${option.code.toLowerCase()}.png 2x`}
                    alt=""
                  />
                  {option.label}
                </Box>
              )}
              renderInput={(params) => (
                <pField
                  {...params}
                  label="Select"
                  inputProps={{
                    ...params.inputProps,
                    autoComplete: "new-password",
                  }}
                />
              )}
            />
          </div>
        </div>
      </Box>
    </div>
  );
};

export default Matching;
